        },

    ]
    const dispatch = useDispatch()

    React.useEffect(() => {
        dispatch(ListRestaurants())
    }, [dispatch])

    const useStyles = makeStyles(theme => ({
        image: {
            position: 'fixed',
            width: '100%',
            zIndex: '-100',
            minHeight: '200px'
        },
        title: {
            position: 'relative',
            ...theme.typography.content,
            textAlign: 'center',
            fontSize: '3rem',
            top: '50px',
            color: 'black',

        }
    }))

    const classes = useStyles()

    return (
        <div>
            <img src={rs_bg} alt='bg-green' className={classes.image} ></img>
            <h1 className={classes.title} >ALL RESTAURANTS LIST</h1>
            <Grid xs={12} direction='row' container justify='space-evenly'
                style={{
                    marginTop: '70px',
                }}  >
                {restaurants?.map(item => (
                    <Grid xs={6} direction='column' justify='center' spacing={6} md={4} item >
                        <Restaurant 
                        name={item.name}
                        address={item.address}
                        city={item.city}
                        state={item.state}
                        pincode={item.pincode}
                        />
                    </Grid>
                ))}
            </Grid>
        </div>
    )
}

export default RestaurantsListScreen
